import React from "react";

const Search = () => {
  return (
    <>
      <div className="relative bg-black px-6 pb-8 pt-10">
        <input
          type="search"
          placeholder="Enter a movie name"
          className="w-full h-10 px-5 rounded-lg text-white bg-gray-800 ring-1 ring-white focus:outline-none "
        />
      </div>
    </>
  );
};

export default Search;
